/* harmony default export */ __webpack_exports__["default"] = ("<!--\n  Generated template for the PartneragreementPage page.\n\n  See http://ionicframework.com/docs/components/#navigation for more info on\n  Ionic pages and navigation.\n-->\n<ion-header class=\"ujb_header ujb_header_sm\">\n\n  <div class=\"statusBarPlaceholder\" showWhen=\"ios\"></div>\n  <ion-toolbar>\n    <ion-title>{{listed}} Partner Agreement</ion-title>\n  </ion-toolbar>\n\n</ion-header>\n\n<ion-content padding>\n  <!-- <pdf-viewer [src]=\"url\"></pdf-viewer> -->\n  <!-- <div id=\"frame\" style=\"height: 100%;\" (load)=\"onPdfLoaded(this.src)\">\n        <embed [src]=\"url\" width=\"500\" height=\"375\">\n    </div> -->\n  <!-- <current code to load pdf for partner aggreement>\n   <ion-spinner id=\"loader\"  color=\"primary\"></ion-spinner>\n  <iframe id=\"myFrame\" [src]=\"url\" width=\"100%\" height=\"100%\" frameborder=\"0\"\n  (load)=\"onPdfLoaded(this.src)\"></iframe> -->\n\n  <!--  <div #viewerContainer\n  class=\"viewer-container\">\n <div #viewer\n      class=\"viewer\">\n     <ng-container #pagesContainer>\n         <div #pageContainer\n              class=\"page\"\n              [style.width.px]=\"pageContainerUnique.width\"\n              [style.height.px]=\"pageContainerUnique.height\">\n\n             <div class=\"canvas-wrapper\"\n                  #canvasWrapper>\n                 <canvas class=\"page-canvas\"\n                         #canvas></canvas>\n\n             </div>\n             <div #textContainer\n                  class=\"text-layer selectable\">\n             </div>\n         </div>\n     </ng-container>\n </div>\n</div> -->\n  <div class=\"container li-style\">\n\n    <p>This Agreement (Partner Agreement) is entered by and between: </p><br>\n    <p>\n      <b>Ujustbe Enterprise</b>, a duly registered partnership firm represented by its Partner a\n      duly registered partnership firm\n      represented by its Partner Mrs. Kavita Ubhe, having its registered office at 3/314 Oshiwara\n      Shantivan C CHSL, Off New\n      Link Road Oshiwara, Andheri(West), Mumbai  400 053, hereinafter referred to as (\n      <b>Ujustbe</b> which expression shall, unless it be repugnant to the subject or context\n      thereof, include its successors\n      and permitted assigns), and </p><br>\n    <p>{{name}}, an individual residing at {{address}},\n      hereinafter referred to as (\n      <b>Partner</b>) which expression shall, unless it be repugnant to the subject or context\n      thereof, include his/its successors)</p>\n\n    <br>\n    <p>\n      <b>Ujustbe</b> and\n      <b>Partner</b> may be referred to herein individually as a\n      <b>Party</b> and collectively as the\n      <b>Parties</b>.</p><br><br>\n    <h4>WHEREAS :- </h4>\n    <ol type=\"A\">\n      <li>Ujustbe has developed and launched a mobile application (Ujustbe APP / APP ). The APP is\n        a referral platform to provide\n        its registered members (Registered Partners) opportunities to earn active and passive\n        referral fees by passing business\n        referrals to other Registered Partners who have showcased their business/ services on the\n        Platform (Listed Partner).\n      </li>\n      <li>Registered Partner has been introduced to the APP by Rajeev Ubhe as its mentor\n        (Mentor).\n      </li>\n      <li>The referrals are provided by other Registered Partners on the APP.</li>\n      <li>Registered Partner may refer any business opportunities to the Listed Partners on the APP/\n        Platform.\n      </li>\n      <li>For every successful reference which has been converted into a business for such Listed\n        Partner (Deal). The Listed\n        Partner is obligated to pay a referral fees as a % (percentage) of the Deal price (Deal\n        Value) or a certain fixed amount\n        (Referral Fees). The Referral Fees shall be payable by the Listed Partner within 10\n        working days from the date of on\n        receipt of the Deal Value or and.\n      </li>\n      <li>The Referral Fees is distributed amongst the Registered Partner (for providing the\n        reference), the Mentor and UJustBe.\n      </li>\n      <li>The purpose of this Partner Agreement is to establish the terms under which Partner shall\n        be affiliated/associated/\n        registered with UJustBe. UJustBe and Partner agree as follows:\n      </li>\n    </ol>\n    <h3>NOW THEREFORE THIS PARTNER AGREEMENT WITNESSETH AS UNDER:</h3>\n    <ol>\n      <li>\n\n        <h5>REGISTRATION </h5> Partner shall be registered on the APP only if it/he/she is a\n        registered UJustBe Partner\n        and has provided the details and documents as has been specified and in the form as designed\n        by UJustBe and fulfils\n        the criteria of registration including payment of the registration fees.\n      </li>\n      <li>\n\n        <h5>TERM/TERMINATION </h5> Partner shall be registered on the APP only if it/he/she is a\n        registered UJustBe Partner\n        and has provided the details and documents as has been specified and in the form as designed\n        by UJustBe and fulfils\n        the criteria of registration including payment of the registration fees.\n      </li>\n      <li>\n\n        <h5>FEES</h5>\n\n        <ol type=\"a\">\n          <li> To Ujustbe Platform UJustBe shall charge a nominal fees at the time of registration.\n            However, this fees would\n            be adjusted from the Referral Fees to be paid to the Partner for a successful referrals.\n          </li>\n          <li>\n            To Partner\n            <ol type=\"i\">\n              <li>The Referral Fees as received by UJustBe from the Listed Partner referred by the\n                Partner shall be apportioned\n                between the Partner its Mentor and UJustBe. Currently the Referral Fees received by\n                UJustBe is apportioned\n                amongst Partner, Mentor and UjustBe in 50:30:20 ration respectively. However, this\n                ratio may be amended in\n                future with due notice. Such amendment in the ratios shall be prospective in nature\n                and shall not impact the\n                deals already carried under the aforesaid agreed %.\n              </li>\n              <li>The Partner shall be entitled for its share in the Referral Fees and the same\n                shall be due and payable by\n                UJustBe only on receipt of the same from referred customer.\n              </li>\n              <li>UJustBe shall share/ transfer/ pay the entitled portion of the Referral Fees to\n                Partner within 10 working\n                days from the date of receipt of the same from the Listed Partner.\n              </li>\n              <li>The Referral Fees will be for every purchase order from new or existing customers\n                referred by the Partner\n                to the Listed Partner.\n              </li>\n            </ol>\n          </li>\n        </ol>\n\n      </li>\n      <li><h5>WARRANTIES AND DUTIES OF PARTNER</h5>\n        <h6>Partner Warrants that</h6>\n        <ol type=\"a\">\n          <li>It has full capacity to enter into this Partner Agreement;</li>\n          <li>That the business opportunities as may be referred by Partner to the Listed Partner\n            are from known and reliable sources and have not been gathered from general\n            advertisements.\n          </li>\n          <li>It shall use the APP only to fulfil its objectives of business referrals and shall do\n            that in compliance with the terms of this Partner Agreement;\n          </li>\n          <li>As between the parties, all rights, title and interest (including all intellectual\n            property rights) of UJustBe shall remain UJustBes exclusive property. It shall not\n            claim any right of whatsoever nature on the intellectual property rights of UJustBe\n            including but not limited to the Trademark of UJustBe or the database.\n          </li>\n        </ol>\n\n        <h6>Partner agrees that </h6>\n        <ol type=\"a\">\n          <li>It shall conduct its activities in accordance with this Partner Agreement, as amended\n            from time to time;\n          </li>\n          <li>It shall not enter into any direct deal with the Listed Partners listed on the APP\n            outside the APP without knowledge of UJustBe.\n          </li>\n          <li>Not create or impose any liability on UJustBe;</li>\n          <li>It shall always be in compliant with the General Terms of Use as provided and agreed\n            on the UJustBe APP and this Partner Agreement.\n          </li>\n          <li>It shall be sole responsibility of the Partner for any and all claims with respect to\n            the business opportunity being introduced by the Partner. However, verifying the\n            business opportunity, quantum, payment and payment terms etc. shall be done mutually\n            between the customer and Listed Partner.\n          </li>\n        </ol>\n      </li>\n      <li>\n        <h5>WARRANTIES AND DUTIES OF UJUSTBE </h5>\n        <h6>Ujustbe Warrants that</h6>\n        <ol type=\"a\">\n          <li>It has full capacity to enter into this Partner Agreement;</li>\n          <li>It shall not claim any right of whatsoever nature on the intellectual property rights\n            of the Partner including but not limited to the Trademark of Partner.\n          </li>\n        </ol>\n\n        <h6>Ujustbe agrees that</h6>\n        <ol type=\"a\">\n          <li>Coordinate with Listed Partner for the follow-up necessary to fulfil the terms of this\n            Partner Agreement;\n          </li>\n          <li>Provide confirming data as may be available to it to Partner regarding each\n            referral.\n          </li>\n          <li>UJustBe is committed to protecting the integrity of its network data and no data will\n            be disclosed or used without the written permission of the UJustBe Partner involved,\n            unless previously agreed to in the Partner/ Listed Partner Agreement as the case may be.\n          </li>\n          <li>Partner shall not be responsible in any manner whatsoever for any payment delays or\n            non-payment to the Listed Partner by the customer.\n          </li>\n        </ol>\n\n      </li>\n      <li><h5>CONFIDENTIALITY </h5>The parties agree that the files maintained by UJustBe, this\n        Partner Agreement, all correspondence, customer lists, papers, documents, computer software,\n        marketing, training, educational, and any other materials, including copies thereof made by\n        or for Listed Partner, furnished to Listed Partner by UJustBe is confidential business\n        information (Confidential Information) and the sole property of UJustBe. In the event the\n        association between UJustBe and Partner should expire or terminate for any reason, Listed\n        Partner shall promptly return all such Confidential Information to UJustBe. Partner further\n        agrees, during the term and at all times after termination or expiration of this Partner\n        Agreement, not to directly or indirectly furnish or disclose to any person or entity any\n        Confidential Information without UJustBes prior written consent. After said termination or\n        expiration, Partner shall not use any Confidential Information to his or her own advantage\n        or to the advantage of any other person or entity\n      </li>\n      <li><h5>LIMITATION ON AUTHORITY </h5>Partner shall have no authority to bind UJustBe by any\n        acts, omissions, statements, promises or representations unless specifically authorized to\n        do so in writing by UJustBe. UJustBe shall not be liable to Partner or responsible to other\n        persons or entities for any expenses incurred by Partner or for any of Partners acts.\n      </li>\n      <li><h5>INDEMNIFICATION </h5>Partner agrees to indemnify UJustBe and hold it harmless from all\n        claims, demands and liability, including costs, attorney fees, and damages of any nature, to\n        which UJustBe may be subjected by reason of any conduct, act and/or omission by Partner, or\n        misrepresentations or promises made by Partner, including, without limitation, acts which\n        may be deemed to be outside the scope of this Partner Agreement.\n      </li>\n      <li><h5> NOTICE </h5>\n        Any notice required or permitted to be given under this Partner Agreement shall be given in\n        writing and shall be emailed, sent by certified or registered mail or sent to the (a)\n        Partner as set forth later in this Partner Agreement, or at such address or e-mail address\n        as it may have specified in writing to UJustBe, and (b) to UJustBe at the below address or\n        at such\n        location as UJustBe shall have specified in writing to Partner as its principal office. <br>\n        <h6>Ujustbe Enterprise 3/314 Oshiwara Shantivan C CHSL,\n          Off New Link Road, Oshiwara,\n          Andheri(West),\n          Mumbai  400 053, India\n          <a href=\"mailto:Connectujustbe@gmail.com\">Connectujustbe@gmail.com</a></h6></li>\n      <li><h5>GOVERNING LAW </h5>The Parties agree that this Partner Agreement, and any disputes\n        arising out of or related to this Partner Agreement, shall be governed by, construed, and\n        enforced in all respects in accordance with the laws of India. The Courts at Mumbai shall\n        have exclusive Jurisdiction. In the event of any matter under this Partner Agreement is\n        litigated between the parties, this Partner Agreement shall be suspended till the conclusion\n        of the litigated matter.\n      </li>\n      <li><h5>INTERPRETATION </h5>This Partner Agreement does not create, and shall not be construed\n        as creating, any rights enforceable by any person not a party to this Partner Agreement. The\n        headings of the Sections contained in this Partner Agreement are inserted for convenience of\n        reference only and are not intended to be a part of or to affect the meaning or\n        interpretation of this Partner Agreement\n      </li>\n      <li><h5>MISCELLANEOUS PROVISIONS </h5>\n        <ol type=\"(a)\">\n          <li>This Partner Agreement (including the membership Criteria, and any addenda thereto)\n            constitutes the entire Agreement between the Parties. No other warranties,\n            representations, undertakings or promises, whether oral, implied or otherwise, have been\n            made by either party hereto. This Partner Agreement supersedes all prior agreements\n            between the Parties, written or oral.\n          </li>\n          <li>As a condition of affiliation with UJustBe, Partner consents and agrees that UJustBe\n            may use Partners name and information regarding any public transaction involving\n            Partner in UJustBes marketing and advertising, including, without limitation,\n            brochures, newsletters, emails, and websites. Partner may withdraw this consent by\n            notifying UJustBe, in writing, as detailed in Section\n          </li>\n        </ol>\n      </li>\n    </ol>\n  </div>\n</ion-content>\n\n<ion-footer class=\"thisPagefooter\">\n  <button (click)=\"Accept()\" class=\"ujb_btn_blue\" id=\"acceptBtn\">Accept</button>\n  <div text-center>\n    <span (click)=\"notNow()\" class=\"ujb_link\">Decline</span>\n  </div>\n</ion-footer>\n\n\n<!--\n\n  <ion-spinner id=\"loader\"  color=\"primary\"></ion-spinner>\n<iframe [src]=\"url\"\n        onload=\"if(this.src) document.getElementById('loader').style.display = 'none'\"></iframe>\n\n\n        onload=\"if(this.src) document.getElementById('loader').style.display = 'none'\"></iframe>\n -->\n");

